import React from "react";

const Character = () => {
  return (
    <div className="main-character">
      <div className="character-page">
        <h2>Character name</h2>
      </div>
      <div className="character-feedback">
        <h3>Feedback</h3>
      </div>
    </div>
  );
};

export default Character;
